import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="navbar">
        <div style={{display: "contents"}}>
          {/* <Link className="a-nav nav-list nav-item-left" to=""><svg width="120" height="80" viewBox="0 0 55 23" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path  fill="white"/></svg>
          </Link> */}
          <Link>
            <svg src="../public/assets/smile.svg" />
          </Link>
        </div>
      <ul className='nav-list'>
        <li>
          <a className="a-nav" href="#about">about</a>
        </li>
        <li>
          <a className="a-nav" href="#projects">projects</a>
        </li>
        <li>
          <a className="a-nav" href="#contact">contact</a>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
